import styled from 'styled-components';

export const Container = styled.div`
width: 100%;
height: 50 px;
background: #20295F;
border-top: 5px solid #EE6B26;

position: fixed;
bottom: 0;
display: flex;

span {
    color: #FFF;
    align-items: center;
    justify-content: center;
}
`
